import React, { Component } from 'react'
import { listEmployee } from "../../redux/actions/Employee_list";
import { connect } from 'react-redux';
import { Collapse, Form, Button, Tabs, Layout, Input, TextArea, List } from 'antd';


class EmployeeList extends Component {

    constructor(props) {
        super(props);
        this.state = ({
            products: []
        });
    }

    componentDidMount() {

        //this.setState({ this.props.products: Array.from(this.props.empList) })
        this.props.dispatch(listEmployee())

    }

    renderProducts() {
        this.setState({ products: this.props.empList })
        return this.state.products.map(product => {
            return (
                <tr key={product.id}>
                    <td>{product.name}</td>

                </tr>
            );
        })
    }

    render() {

        return (
            <table className="table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>

                    </tr>
                </thead>

                <tbody>
                    {this.renderProducts()}
                </tbody>
            </table>
        )
    }
}
function mapStateToProps(state) {
    return {

        empList: state.empList.result

    };
}
export default connect(mapStateToProps)(EmployeeList);
//export default EmployeeList;
